Bookplate of the Biblioteca Valperga di Masino e di Caluso (Torino, Italy) with ms. shelfmark: &quot;X.490&quot;
Its heritage consists of the volumes collected over the centuries by the family Valperga di Masino, one of the oldest and most important noble families in Piedmont. The <a href="http://www.regione.piemonte.it/cultura/cms/banche-dati/biblioteche-dei-musei/632-biblioteca-valperga-di-masino-e-di-caluso.html" rel="nofollow">library</a> still exists today.

Penn Libraries call number: IC6 B6448 559r

Bookplate of Edgar F. Leo
&quot;Book dreams are each a world&quot;

Penn Libraries call number: IC55 T1856 Eg660d
